import React from 'react';
import data from "./myData.json";
import $ from 'jquery';
import Header from './components/Header.js';
import About from './components/About.js';
import Services from './components/Services.js';
import Portfolio from './components/Portfolio.js';
import Contact from './components/Contact.js';
import Footer from './components/Footer.js';
import './style.scss';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'font-awesome/css/font-awesome.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';

import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

const AllDataList = data.main;

class App extends React.Component {

   render() {
      return (
         <div className="main">
         <Router>
               <Header data={this.state.AllDataList.main} />
         </Router>
         <About data={this.state.AllDataList.main} />
         <Services data={this.state.AllDataList.main}/>
         <Portfolio data={this.state.AllDataList.main} />
         <Contact data={this.state.AllDataList.main} />   
         <Footer data={this.state.AllDataList.main} />    
         </div>
      );
   }
}
export default App;
